    "2016-05-26T06:02:13.044160",nt"name": "daily-arrests",nt"isopen": false,nt"url":
    null,nt"notes": "This dataset provides the public with arrest information from
    the Montgomery County Central Processing Unit (CPU) systems. The data presented
    is derived from every booking; criminal, civil and motor vehicle entered through
    CPU. The data is compiled by u201cCRIMSu201d, a respected jail records-management
    system used by the Montgomery County Corrections and many other law enforcement
    agencies. To protect arresteeu2019s privacy, personal information is redacted. Residential
    addresses are rounded to the nearest hundred block. All data is refreshed on 2 hour
    basis to reflect any additions or changes. rn-Information that may include mechanical
    or human error rn-Arrest information [Note: all arrested persons are presumed innocent
    until proven guilty in a court of lawrn- Records will be removed after 30 days.rnUpdate
